    "narrative-report-bowdoin-national-wildlife-refuge-september-1-to-december-31-1950",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Bowdoin NWR outlines
    Refuge accomplishments from September through December of 1950. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    rodents, mammals, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and collections and receipts.
    Resource management is outlined; topics include grazing and fur harvesting. The
    public relations section of the report describes recreational uses, Refuge visitors,
    Refuge participation, hunting, fishing, and violations. N-R forms and photographs
    are attached. An update on Lake Thibedeau, Creedman's Coulee, Black Boulee, and
    Hewitt Lake Easement Refuge is also included.",nt"license_title": "License
